import React from 'react';
import useInputValue from '../hooks/useInputValue';

const Input = () => {
  const username = useInputValue('')
  return (
    <>
      <input
        type="text"
        name="username"
        placeholder="username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
    </>
  );
};

export default Input;
